import React, { Suspense, useState, useCallback, useEffect } from 'react';
import { Canvas } from '@react-three/fiber';
import { Environment, OrbitControls, useGLTF } from '@react-three/drei';
import * as THREE from 'three';

function Model({ url }) {
  const gltf = useGLTF(url);

  useEffect(() => {
    if (gltf.scene) {
      const box = new THREE.Box3().setFromObject(gltf.scene);
      const center = box.getCenter(new THREE.Vector3());
      const size = box.getSize(new THREE.Vector3());

      const maxDim = Math.max(size.x, size.y, size.z);
      const scale = 5 / maxDim;

      gltf.scene.position.set(-center.x * scale, -box.min.y * scale, -center.z * scale);
      gltf.scene.scale.setScalar(scale);
    }
  }, [gltf]);

  return <primitive object={gltf.scene} />;
}

function ModelViewer({ modelUrl }) {
  const [isLoading, setIsLoading] = useState(true);
  const [isMobile, setIsMobile] = useState(false);

  useEffect(() => {
    setIsMobile(/iPhone|iPad|iPod|Android/i.test(navigator.userAgent));
    const handleResize = () => setIsMobile(/iPhone|iPad|iPod|Android/i.test(navigator.userAgent));
    window.addEventListener('resize', handleResize);

    // Copy background content
    const content = document.querySelector('.content');
    if (content) {
      const background = document.getElementById('background-content');
      if (background) {
        background.innerHTML = content.innerHTML;
      }
    }

    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const canvasRef = useCallback(node => {
    if (node !== null) {
      setIsLoading(false);
    }
  }, []);

  return (
    <div style={{ 
      width: '100%', 
      height: '100vh', 
      position: 'relative', 
      touchAction: 'none',
      backgroundColor: 'rgba(255, 255, 255, 0.9)'
    }}>
      <div style={{
        position: 'absolute',
        top: 0,
        left: 0,
        right: 0,
        bottom: 0,
        opacity: 0.1,
        pointerEvents: 'none',
        zIndex: -1,
        overflow: 'hidden',
        backdropFilter: 'blur(8px)'
      }}>
        <div style={{
          width: '100%',
          height: '100%',
          filter: 'blur(8px)',
          transform: 'scale(1.1)'
        }} id="background-content" />
      </div>

      {isLoading && (
        <div style={{ position: 'absolute', top: '50%', left: '50%', transform: 'translate(-50%, -50%)' }}>
          Carregando...
        </div>
      )}

      <Canvas
        ref={canvasRef}
        shadows
        camera={{ 
          position: isMobile ? [0, 2, 8] : [0, 5, 15],
          fov: 50,
          near: 0.1,
          far: 1000
        }}
        performance={{ min: 0.5 }}
        dpr={[1, 2]}
        style={{
          background: 'transparent'
        }}
      >
        <color attach="background" args={['transparent']} />
        <ambientLight intensity={0.5} />
        <directionalLight
          castShadow
          position={[10, 10, 10]}
          intensity={1}
          shadow-mapSize-width={1024}
          shadow-mapSize-height={1024}
        />

        <Suspense fallback={null}>
          <Model url={modelUrl} />
          <Environment preset="sunset" />
          <OrbitControls 
            enablePan={!isMobile}
            enableZoom={true}
            enableRotate={true}
            target={[0, 0, 0]}
            minDistance={2}
            maxDistance={20}
          />
        </Suspense>
      </Canvas>

      {isMobile && (
        <div style={{
          position: 'absolute',
          bottom: '10px',
          left: '50%',
          transform: 'translateX(-50%)',
          color: '#666',
          fontSize: '14px',
          textAlign: 'center',
          padding: '8px',
          backgroundColor: 'rgba(255, 255, 255, 0.8)',
          borderRadius: '4px'
        }}>
          Arraste para girar • Pinça para zoom
        </div>
      )}
    </div>
  );
}

export default ModelViewer;
